import React from 'react'
import { ListGroup } from 'reactstrap'
import { Link } from 'react-router-dom';

function Menu(){
    return (
      <div>
       <nav className="w-full px-au md:max-w-[300px] ">
          <ul className="flex flex-col justify-center p-6 text-gray-800 bg-gray-700">
            <li className='text-xl py-3 flex'>Home</li>
            <li className='text-xl py-3 flex'>View Courses</li>
            <li className='text-xl py-3 flex'>Add Courses</li>
            <li className='text-xl py-3 flex'>Contact Us</li>
            <li className='text-xl py-3 flex'>About Us</li>
          </ul>
        </nav>
      </div>
    ); 
}

export default Menu;
